      </a>
    )
  },
  days: {
    nl: "dagen",
    fr: "jours"
  },
  day: {
    nl: "dag",
    fr: "jour"
  },
  hours: {
    nl: "uren",
    fr: "heures"
  },
  hour: {
    nl: "uur",
    fr: "heur"
  },
  minutes: {
    nl: "minuten",
    fr: "minutes"
  },
  minuut: {
    nl: "minuut",
    fr: "minute"
  },
  seconds: {
    nl: "seconden",
    fr: "secondes"
  },
  second: {
    nl: "seconde",
    fr: "seconde"
  }
};
